    private ByteArrayOutputStream gzcompress(byte[] toCompress) throws IOException {
        ByteArrayOutputStream stringBuffer=new ByteArrayOutputStream();
        GZIPOutputStream compress=new GZIPOutputStream(stringBuffer,512,true);
        compress.write(toCompress);

        compress.finish();
        compress.close();
        return stringBuffer;
    }

    private String ungzcompress(@NotNull byte[] toUnCompress) throws IOException {
        ByteArrayInputStream in = new ByteArrayInputStream(toUnCompress);
        GZIPInputStream ungzip = new GZIPInputStream(in);
        return new String(ungzip.readAllBytes());
    }
